  return <button className='square'>{value}</button>
}


export default function Board() {
  return (
    <>
      <div className='board'>
        <Square value="1" />
        <Square value="2" />
        <Square value="3" />
        <Square value="4" />
        <Square value="5" />
        <Square value="6" />
        <Square value="7" />
        <Square value="8" />
        <Square value="9" />
      </div>
    </>
  )
}
